import axios from "axios";

export class PersonaService{
    baseUrl="http://localhost:30902/api"
    getAll(){
        return axios(this.baseUrl+"/hello", {
            method: 'GET',
            mode: 'cors',
            headers: {
                "Access-Control-Allow-Origin": "http://localhost:3000",
              "Content-Type": "application/json",
            }}).then(res => res.data)
    }
}
